import React, { useEffect, useState } from "react";
import "./rowpost.css";
import axios from "../../Axios";
import { API_KEY ,imgaeUrl} from "../../constants/constants";

function Rowpost() {
  const [movies, setMovies] = useState([]);
  useEffect(() => {
    axios
      .get(`discover/tv?api_key=${API_KEY}&with_networks=213`)
      .then((response) => {
        console.log(response.data.results);
        setMovies();
      });
  });
  return (
    <div>
      <h2 className="row">Netflix Orginals</h2>
      <div className="posters">
        {movies.map((obj) => 
          <img
            className="poster"
            src={`${imgaeUrl+obj.backdrop_path}`}
            alt="poster"
          />
        )}
      </div>
    </div>
  );
}

export default Rowpost;
